script: |
  super -f text -I q11742.spq | sort > q11742.out

inputs:
  - name: q11742.spq
    data: |
      SELECT - - ( 3 ) * - cor0.col0 * + 1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q11742.out
    data: |
      -192
      -192
      -192
      -240
      -240
      -240
      -9
      -9
      -9
